
        <!DOCTYPE html>
        <html>
        <head>
            <meta charset="UTF-8">
            <title>ECUBus-Pro - Test Report</title>
            <style>
                body {
                    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
                    max-width: 1200px;
                    margin: 0 auto;
                    padding: 20px;
                    background: #f5f7fa;
                }
                .container {
                    background: white;
                    border-radius: 8px;
                    box-shadow: 0 2px 12px 0 rgba(0,0,0,0.1);
                    padding: 20px;
                }
                .report-header {
                    display: flex;
                    align-items: center;
                    gap: 20px;
                    margin-bottom: 20px;
                    padding-bottom: 20px;
                    border-bottom: 1px solid #ebeef5;
                }
                .logo-container {
                    display: flex;
                    align-items: center;
                }
                .logo {
                    width: 64px;
                    height: 64px;
                    margin-right: 16px;
                }
                .software-info {
                    flex: 1;
                    padding-top: 0;
                }
                .software-name {
                    font-size: 24px;
                    color: #303133;
                    margin: 0;
                }
                .report-title {
                    font-size: 18px;
                    color: #606266;
                    margin: 4px 0;
                }
                .script-info {
                    color: #606266;
                    font-size: 14px;
                    margin-top: 4px;
                }
                .timestamp {
                    color: #909399;
                    font-size: 14px;
                }
                .test-case {
                    margin: 8px 0;
                }
                .test-header {
                    display: flex;
                    align-items: center;
                    font-size: 14px;
                    padding: 8px;
                    border-radius: 4px;
                    background: #f8f9fb;
                }
                .icon {
                    margin-right: 8px;
                }
                .name {
                    flex: 1;
                }
                .time {
                    color: #909399;
                    font-size: 12px;
                    margin-left: 8px;
                }
                .children {
                    margin-left: 20px;
                }
                .footer {
                    margin-top: 40px;
                    padding-top: 20px;
                    border-top: 1px solid #ebeef5;
                    color: #909399;
                    font-size: 14px;
                    text-align: center;
                }
                
                .footer a {
                    color: var(--el-color-primary);
                    text-decoration: none;
                }
                
                .footer a:hover {
                    text-decoration: underline;
                }
                
                .footer-links {
                    display: flex;
                    justify-content: center;
                    gap: 20px;
                }
            </style>
        </head>
